Generate a creative twitter bio for user input: CLEBER  TREVISAN

- Graduado em Análise de Sistemas pela Universidade Salgado de Oliveira;
- Pós-graduado em TI Aplicada a Gestão de Negócios pela FGV;
- Acadêmico do 9.º Periodo de Direito, foco em Direito Digital;
- Experiência ampla em Programação e Lógica Matemática;
- Cursos em I.As com conhecimentos em Prompts e LGPD;. In the tone : professional.
 "bio":"Cleber Trevisan: IT professional with a degree in Systems Analysis, postgraduate in IT applied to Business Management, and currently studying Law with a focus on Digital Law. Extensive experience in Programming and Mathematical Logic. Proficient in AI, Prompts, and LGPD."

